{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"cell_type":"markdown","source":"# Tidyverse\n\n![image.png](attachment:9d306063-9d35-4507-98f2-7360cad045ce.png)\n\n[tidyverse](https://www.tidyverse.org) in R, one of the Important packages in R, there are a lot of new techniques available maybe users are not aware of.\n\nIn this live code-along session, you'll learn the basic principles of analyzing your data using R and the tidyverse. You'll code along with Hugo to explore the Titanic dataset and discover how you can use packages (i.e. sets of tools for doing stuff with data) in the tidyverse to get from data to insight as intuitively and efficiently as possible. But seriously: if you want to filter your data, you use the verb (or function) `filter`; if you wish to arrange it in a particular order, you use `arrange`. The tidyverse set of tools is a revolution that consists of computational tools that intuitively mirror how we all think about data.\n\nBe part of the revolution. Join us code along to use these tools to explore the Titanic dataset, which consists of observations of passengers on the infamous ship, many of their characteristics and whether they survived or not.","metadata":{},"attachments":{"9d306063-9d35-4507-98f2-7360cad045ce.png":{"image/png":""}}},{"cell_type":"markdown","source":"## Installation\n\n- Install [R](https://cran.r-project.org/mirrors.html) from here.\n- Install [RStudio](https://www.rstudio.com/products/rstudio/download/) from here.\n- Follow Jenny Bryan's instructions here to test your set-up (note: it is not necessary to establish communication between RStudio and Git for this session).\n- Install all the packages in the tidyverse by running `install.packages(\"tidyverse\")` in RStudio.","metadata":{}},{"cell_type":"code","sou